import classes from "./Dialogue.module.css"

const Dialogue = () => {
    return(
      <div className={classes.alldialogues}>
          <div className={classes.con}>
              div.block
          <img className={classes.prof} src='https://images.unsplash.com/photo-1611915387288-fd8d2f5f928b?ixlib=rb-1.2.1&q=80&fm=jpg&crop=entropy&cs=tinysrgb&w=1080&fit=max'></img>

          <div className={classes.block}>Vlad</div>
          <div className={classes.block}>Andriy</div>
          <div className={classes.block}>Leha</div>
          <div className={classes.block}>Morgenshtern</div>
          </div>
      </div>
    );
}

export default Dialogue;
